import React from 'react'

function Home() {


    const getData = async () => {
        const response = await fetch('http://localhost:9000', {
            mode: 'no-cors'
        });
        const data = await response.json();
        console.log("TEST", data);
    }

    return (
        <div className='mt-5'>
            <h1>HOME PAGE</h1>
            <button onClick={getData}>FETCH DATA</button>
        </div>
    )
}

export default Home;
